BEGIN
EXEC dbo.sp_executesql @statement = N'
CREATE PROCEDURE [dbo].[uspInsertStudent] @UserName varchar(100),
							   @Name varchar(100),
							   @LastName varchar(100),
							   @Cellphone varchar(80),
							   @Workphone varchar(80),
							   @Homephone varchar(80),
							   @Gender char(1),
							   @Email varchar(256)
as
BEGIN

	DECLARE @UserId uniqueidentifier
SET @UserId = NEWID()

DECLARE @ApplicationId uniqueidentifier
SELECT @ApplicationId = ApplicationId from dbo.Applications where ApplicationName = ''MatriFun''



INSERT INTO dbo.Users
SELECT @ApplicationId, @UserId, @UserName, 0,GETDATE()

INSERT INTO dbo.Memberships ( ApplicationId	,UserId	,[Password]	,PasswordFormat	,PasswordSalt	,Email	,PasswordQuestion	,PasswordAnswer	 ,IsApproved	,IsLockedOut	,CreateDate	,LastLoginDate	,LastPasswordChangedDate	,LastLockoutDate ,FailedPasswordAttemptCount	,FailedPasswordAttemptWindowStart	,FailedPasswordAnswerAttemptCount	,FailedPasswordAnswerAttemptWindowsStart	,Comment)
SELECT 	 @ApplicationId	,@UserId	,''tflxrK3JDQKSKT3cNVB2yNrczp4lx7/teAYAxL957IE=''		,1	,''XU5wTvF9Uuiq78hd5o/CNg==''	,@Email	,NULL	,NULL	,1	,0	,GETDATE()	,GETDATE()	,GETDATE()	,GETDATE()	,0	,''17540101''	,0	,''17540101''	,''User create by initial script''
	 
INSERT INTO [dbo].[UsersInRoles]
SELECT @UserId, RoleId from dbo.Roles where RoleName = ''ROLE_STUDENT''


DECLARE @StudentID uniqueidentifier
SET @StudentID = NEWID()

INSERT INTO dbo.Student(StudentID,	InsertDate,	UserID,	IdentificationTypeID,	FirstName,	LastName,	Gender,	DateOfBirth,	CountryID,	MaritalStatusTypeID,	Phone1, Phone2, Phone3,	IsAppUser)
SELECT 
	@StudentID,	GETDATE(),	@UserId,
	IdentificationTypeID = (SELECT TypeID FROM dbo.[Type] WHERE Name = ''NATIONAL_ID''),
	FirstName = @Name,
	LastName = @LastName,
	Gender = @Gender,
	DateOfBirth = ''20000101'',
	CountryID = (SELECT CountryID FROM dbo.Country WHERE CountryName = ''Costa Rica''),
	MaritalStatusTypeID = (SELECT TypeID FROM dbo.[Type] WHERE Name = ''MARITAL_STATUS_SINGLE''), -- <= MARITAL_STATUS_MARRIED
	Phone1 = @Cellphone,
	Phone2 = @Workphone,
	Phone3 = @Homephone,
	IsAppUser = 0
	
END' 
END
