/****** Object:  StoredProcedure [dbo].[uspInsertStudentsInTemp]    Script Date: 06/22/2013 15:30:12 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[uspInsertStudentsInTemp]') AND type in (N'P', N'PC'))
BEGIN
EXEC dbo.sp_executesql @statement = N'
create procedure [dbo].[uspInsertStudentsInTemp]

as

begin

declare @cedula varchar(80)
declare @nombre varchar(80)
declare @apellidos varchar(80)
declare @tel1 varchar(80)
declare @tel2 varchar(80)
declare @tel3 varchar(80)
declare @correo varchar(80)
declare @genero varchar(80)

declare Verificador cursor local for select TempStudents.cedula from TempStudents
declare Matriculador cursor local for select TempStudents.cedula from TempStudents where TempStudents.estado = 0


open Verificador
fetch next from Verificador into @cedula
while @@FETCH_STATUS = 0
begin
	--Si encuentra que el estudiante ya está registrado le cambia el estado a 1.
	if((select COUNT(Users.UserId) from Users where Users.UserName = @cedula)>0)
	begin
		update TempStudents
		set estado = 1
		where cedula = @cedula
	end
	
	fetch next from Verificador into @cedula
end

close Verificador
deallocate Verificador

open Matriculador
fetch next from Matriculador into @cedula
while @@FETCH_STATUS = 0
begin
	
	Select @nombre = nombre, @apellidos = apellidos, @tel1 = tel1, @tel2 = tel2, @tel3 = tel3, @correo = correo, @genero = genero
	from TempStudents where cedula = @cedula
	
	EXEC uspInsertStudent @UserName = @cedula, @Name = @nombre, @LastName = @apellidos, @Cellphone = @tel1, @Workphone = @tel2, @Homephone = @tel3, @Gender  = @genero , @Email = @correo
	
	fetch next from Matriculador into @cedula
end

close Matriculador
deallocate Matriculador

delete from TempStudents
where estado = 0 or estado = 1

end' 
END
GO
