/****** Object:  View [dbo].[SchemeDetails]    Script Date: 06/22/2013 15:30:12 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.views WHERE object_id = OBJECT_ID(N'[dbo].[SchemeDetails]'))
EXEC dbo.sp_executesql @statement = N'

--- Alter View Scheme Details, Add School        
CREATE VIEW [dbo].[SchemeDetails]        
AS        
SELECT s.SchemeID,       
  s.Name SchemeName,       
  s.Description,      
  s.OwnerUserId,      
  ISNULL(u1.UserName,'''') OwnerName,      
  s.CoordinatorUserId,      
  ISNULL(u2.UserName, '''') CoordinatorName,      
  s.ModalityID,      
  m.Name ModalityName,  
  s.SchoolID,  
  ISNULL(sc.Name, '''') SchoolName  
FROM Scheme s    
INNER JOIN Modality m ON s.ModalityID = m.ModalityID      
LEFT JOIN Users u1 ON u1.UserId = s.OwnerUserId      
LEFT JOIN Users u2 ON u2.UserId= s.CoordinatorUserId    
LEFT JOIN School sc ON sc.SchoolID = s.SchoolID  
--- Add primary key to table school - scheme  '
GO
/****** Object:  View [dbo].[PlanDetails]    Script Date: 06/22/2013 15:30:12 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.views WHERE object_id = OBJECT_ID(N'[dbo].[PlanDetails]'))
EXEC dbo.sp_executesql @statement = N'--- ALTER VIEW [dbo].[PlanDetails] Add isActive
CREATE VIEW [dbo].[PlanDetails]  
AS  
SELECT sp.SchemeID,  
  s.Name AS SchemeName,      
  p.PlanID,   
  p.Name AS PlanName,  
  p.[Description],  
  p.[Version],
  p.isActive   
FROM [Plan] p  
INNER JOIN [Scheme-Plan] sp ON p.PlanID = sp.PlanID  
INNER JOIN Scheme s ON s.SchemeID = sp.SchemeID  
WHERE isActive = 1
'
